import React from "react";
import "./Chat.css";
const Chat = () => {
  return (
    <div className="chat">
      <div className="insideapp">
        <div className="server">
          <h1>Hey</h1>
        </div>
        <div className="leftside">
          <div className="channel1"></div>
        </div>
        <div className="middle">
          <div className="message1"></div>
        </div>
        <div className="rightside">
          <div className="person1"></div>
        </div>
      </div>
    </div>
  );
};

export default Chat;
